import React from 'react';
import {Router, Route, Routes} from 'react-router-dom';
import Home from './components/Home/Home';

import './scss/main.scss';

function App() {
  return (
    <Router>

      <Routes>
        <Route path="/" element={<Home />} />

      </Routes>

</Router>

     );
}

export default App;
